function hsGenerateCustomFieldKey(title) {
  // Remove leading and trailing spaces, convert to lowercase, and replace spaces with underscores
  const formattedTitle = title.trim().toLowerCase().replace(/ /g, '_');

  // Generate a random number between 100000 and 999999 (inclusive)
  const randomNumber = Math.floor(Math.random() * (999999 - 100000 + 1)) + 100000;

  // Combine the formatted title and random number with an underscore
  const result = `${formattedTitle}_${randomNumber}`;
  return result;
}

